import React from 'react';

class Chapitre1 extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            data : ''
        };
    }

    componentDidMount() {
        var chapitre1 = document.getElementById("chapitre1");
        chapitre1.innerHTML = JSON.stringify(Chapitre1());

        function Chapitre1(){
            return <div>
                    <div id="introduction">
                    Petit texte d'introduction
                    Titre
                    Sous Titre
                    Image 
                    Description
                </div>
                <div id="description"></div>
                <p>Chapitre 1 Titre</p>
                <div id="contentDesc"></div>
                <p>Description</p>
                <p>Image ou commentaire</p>
               </div>
        };

    }
    
    render() {
        return <div></div>
        
    }
}

export default Chapitre1;
